import React from "react";
import { stopSubmit } from "redux-form";
import { profileAPI } from "./../api/profile-api";
import { usersAPI } from "./../api/users-api";
import {
  ContactsType,
  PhotosType,
  PostType,
  ProfileType,
} from "../types/types";

const ADD_POST = "ADD-POST";
const SET_USER_PROFILE = "SET_USER_PROFILE";
const SET_STATUS = "SET_STATUS";
const DELETE_POST = "DELETE_POST";
const SAVE_PHOTO_SUCCESS = "SAVE_PHOTO_SUCCESS";
const SAVE_PROFILE_DATA_SUCCESS = "SAVE_PROFILE_DATA_SUCCESS";
const SET_EDIT_MODE = "SET_EDIT_MODE";

type InitialStateType = {
  posts: PostType[];
  profile: ProfileType;
  status: string | null;
  isProfileEditMode: boolean;
};

let initialState: InitialStateType = {
  posts: [
    {
      id: 1,
      title: "One-page site for tourism with fullscren swiper",
      link: "https://offerta.portfolio-example.website/sm-home.html",
      photo:
        "data:image/jpeg;base64,",
      textButton: "Html, scss, js",
      likeCount: 0,
    },

    {
      id: 2,
      title: "Charity Fund to help children cancer (8 pages)",
      link: "https://offerta.portfolio-example.website/timoshas.html",
      photo:
        "data:image/jpeg;base64,",
      textButton: "Html, scss, js",
      likeCount: 20,
    },
    {
      id: 3,
      title: "One-page site for a construction company",
      link: "https://offerta.portfolio-example.website/realstate.html",
      photo:
        "data:image/jpeg;base64,",
      textButton: "Html, scss, js",
      likeCount: 30,
    },
    {
      id: 4,
      title: "Parallax forest",
      link: "https://offerta.portfolio-example.website/parallax-forest.html",
      photo:
        "data:image/jpeg;base64,",
      textButton: "Html, scss, js",
      likeCount: 5,
    },
  ],
  profile: {
    userId: 1,
    lookingForAJob: true,
    lookingForAJobDescription: " ",
    fullName: " ",
    contacts: {
      github: " ",
      vk: " ",
      facebook: " ",
      instagram: " ",
      twitter: " ",
      website: " ",
      youtube: " ",
      mainLink: " ",
    },
    photos: {
      large: null,
      small: null,
    },
  },
  status: "",
  isProfileEditMode: false,
};

const profileReducer = (
  state = initialState,
  action: any
): InitialStateType => {
  switch (action.type) {
    case ADD_POST: {
      return {
        ...state,
        posts: [
          ...state.posts,
          {
            id: 6,
            title: action.newPostBody,
            link: "#",
            photo:
              "data:image/jpeg;base64,",
            textButton: "React",
            likeCount: 0,
          },
        ],
      };
    }

    case SET_STATUS: {
      return {
        ...state,
        status: action.status,
      };
    }
    case SET_USER_PROFILE: {
      return {
        ...state,
        profile: action.profile.data,
        isProfileEditMode: false,
      };
    }
    case SET_EDIT_MODE: {
      return {
        ...state,
        isProfileEditMode: true,
      };
    }
    case DELETE_POST: {
      return {
        ...state,
        posts: state.posts.filter((p) => p.id !== action.postId),
      };
    }
    case SAVE_PHOTO_SUCCESS: {
      return {
        ...state,
        profile: { ...state.profile, photos: action.photos } as ProfileType,
      };
    }
    case SAVE_PROFILE_DATA_SUCCESS: {
      return {
        ...state,
        profile: { ...state.profile, photos: action.photos } as ProfileType,
      };
    }

    default:
      return state;
  }
};

type AddPostActionCreatorType = {
  type: typeof ADD_POST;
  newPostBody: string;
};

export const addPostActionCreator = (
  newPostBody: string
): AddPostActionCreatorType => ({
  type: ADD_POST,
  newPostBody,
});

type SetUserProfileType = {
  type: typeof SET_USER_PROFILE;
  profile: ProfileType;
};

export const setUserProfile = (profile: ProfileType): SetUserProfileType => ({
  type: SET_USER_PROFILE,
  profile,
});
type SetEditModeType = {
  type: typeof SET_EDIT_MODE;
};
export const setEditMode = (): SetEditModeType => ({
  type: SET_EDIT_MODE,
});

type SetUserStatusType = {
  type: typeof SET_STATUS;
  status: string;
};
export const setUserStatus = (status: string): SetUserStatusType => ({
  type: SET_STATUS,
  status,
});
type DeletePostType = {
  type: typeof DELETE_POST;
  postId: number;
};
export const deletePost = (postId: number): DeletePostType => ({
  type: DELETE_POST,
  postId,
});
type SavePhotoSuccessType = {
  type: typeof SAVE_PHOTO_SUCCESS;
  photos: PhotosType;
};
export const savePhotoSuccess = (photos: PhotosType): SavePhotoSuccessType => ({
  type: SAVE_PHOTO_SUCCESS,
  photos,
});
type SaveProfileDataSuccessType = {
  type: typeof SAVE_PROFILE_DATA_SUCCESS;
  formData: ContactsType;
};
export const saveProfileDataSuccess = (
  formData: ContactsType
): SaveProfileDataSuccessType => ({
  type: SAVE_PROFILE_DATA_SUCCESS,
  formData,
});
export const getUserProfile = (userId: number) => (dispatch: any) => {
  usersAPI.getUserProfile(userId).then((profileData: any) => {
    dispatch(setUserProfile(profileData));
  });
};
export const getUserStatus = (userId: number) => (dispatch: any) => {
  profileAPI.getUserStatus(userId).then((res) => {
    dispatch(setUserStatus(res));
  });
};
export const updateStatus = (status: string) => (dispatch: any) => {
  try {
    profileAPI.updateStatus(status).then((res) => {
      if (res.resultCode === 0) {
        dispatch(setUserStatus(status));
      }
    });
  } catch (error) {
    debugger;
  }
};

export const savePhotoss = (photoFile: string) => (dispatch: any) => {
  profileAPI.savePhoto(photoFile).then((res) => {
    if (res.resultCode === 0) {
      dispatch(savePhotoSuccess(res.data.photos));
    }
  });
};

export const saveProfileData =
  (profile: ProfileType) => async (dispatch: any, getState: any) => {
    const userId = getState().auth.userId;
    const res = await profileAPI.saveProfileData(profile);
    if (res.resultCode === 0) {
      dispatch(getUserProfile(userId));
    } else {
      dispatch(stopSubmit("editProfile", { _error: res.messages[0] }));
      return Promise.reject(res.messages[0]);
    }
  };

export default profileReducer;
